use football_manager;
CREATE TABLE `team_has_competitions` (
  `id_team_has_competition` int(11) NOT NULL AUTO_INCREMENT,
  `id_team` bigint(20) DEFAULT NULL,
  `id_competitions` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_team_has_competition`),
  KEY `fk_id_team_idx` (`id_team`),
  KEY `fk_id_competition_idx` (`id_competitions`),
  CONSTRAINT `fk_id_competition` FOREIGN KEY (`id_competitions`) REFERENCES `competitions` (`id_competitions`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_team` FOREIGN KEY (`id_team`) REFERENCES `teams` (`id_teams`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



